import './Expenses.css';
import Card from '../UI/Card';
import ExpenseItem from './ExpenseItem';
import ExpenseForm from '../NewExpense/ExpenseForm';
import ExpensesFilter from '../Expenses/'

function Expenses(lst){

    return(

       
        <Card className="expenses">
        <ExpensesFilter />
      <ExpenseItem 
      title={lst.lst[0].title} 
      amount={lst.lst[0].amount} 
      date={lst.lst[0].date}>
      </ExpenseItem>
      <ExpenseItem 
      title={lst.lst[1].title} 
      amount={lst.lst[1].amount} 
      date={lst.lst[1].date}>
      </ExpenseItem>
      <ExpenseItem 
      title={lst.lst[2].title} 
      amount={lst.lst[2].amount} 
      date={lst.lst[2].date}>
      </ExpenseItem>
      <ExpenseItem 
      title={lst.lst[3].title} 
      amount={lst.lst[3].amount} 
      date={lst.lst[3].date}>
      </ExpenseItem>
      


        </Card>
    );

}

export default Expenses;
